import React from 'react';

const StartIcon = () => {
  return (
    <svg width="50" height="50" viewBox="0 0 50 50" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
      <rect width="50" height="48.4" fill="url(#pattern0)"/>
      <defs>
        <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
          <use xlinkHref="#image0" transform="translate(0 -0.000553788) scale(0.00343643 0.00355003)"/>
        </pattern>
        <image id="image0" width="291" height="282" xlinkHref="data:image/png;base64,"/>
      </defs>
    </svg>
  );
};

export default StartIcon;
